-- ----------------------------
-- Procedure structure for DeleteCharacter
-- ----------------------------
DROP PROCEDURE IF EXISTS `DeleteCharacter`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DeleteCharacter`(IN _uid INT unsigned)
BEGIN
		DELETE FROM characters WHERE UID=_uid;
		DELETE FROM items WHERE Owner=_uid;
		DELETE FROM nobility WHERE UID=_uid;
		DELETE FROM proficiencies WHERE owner=_uid;
		DELETE FROM skills WHERE owner=_uid;
		DELETE FROM associates WHERE UID=_uid;
		DELETE FROM associates WHERE AssociateID=_uid;
		DELETE FROM guildattr WHERE guild_id=(SELECT id from guild where leader_id=_uid);
		DELETE FROM guildattr WHERE id=_uid;
		DELETE FROM guild WHERE leader_id=_uid;
		DELETE FROM tasks WHERE owner=_uid;
	END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for DeleteGuildAttr
-- ----------------------------
DROP PROCEDURE IF EXISTS `DeleteGuildAttr`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DeleteGuildAttr`(IN guildId INT unsigned)
BEGIN
		DELETE FROM guildattr WHERE guild_id=guildId;
	END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for DeleteUserGuildAttr
-- ----------------------------
DROP PROCEDURE IF EXISTS `DeleteUserGuildAttr`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `DeleteUserGuildAttr`(IN userId INT unsigned, IN guildId INT unsigned, IN guildRank SMALLINT unsigned)
BEGIN
		DELETE FROM guildattr WHERE id=userId AND guild_id=guildId AND rank!=guildRank LIMIT 1;
	END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for GetGuildMemberList
-- ----------------------------
DROP PROCEDURE IF EXISTS `GetGuildMemberList`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetGuildMemberList`(IN guildId INT unsigned)
BEGIN
		SELECT u.Name AS Name, g.rank AS Rank, u.Level AS Level, g.donate_silver AS Donation FROM guildattr AS g LEFT JOIN characters AS u ON u.UID=g.id WHERE g.guild_id=guildId && u.UID IS NOT NULL ORDER BY g.rank DESC, u.Level DESC, u.Name;
	END
;;
DELIMITER ;

