-- ----------------------------
-- Procedure structure for GetNobilityRank
-- ----------------------------
DROP PROCEDURE IF EXISTS `GetNobilityRank`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GetNobilityRank`(IN donationvalue BIGINT unsigned)
BEGIN
		SELECT COUNT(*) FROM nobility WHERE Donation>donationvalue;
	END
;;
DELIMITER ;

